import React from "react";

const Footer = () => {
  return (
    <footer className="container">
      <p className="float-right">
        <a href="/">Back to top</a>
      </p>
      <p>
        &copy; 2019-2020 Santos Company, Inc. &middot; <a href="/">Privacy</a>{" "}
        &middot; <a href="/">Terms</a>
      </p>
    </footer>
  );
};

export default Footer;
